  `icat` text,
  `iname` text,
  `cprice` text,
  `cmfg` text,
  `cdesc` text,
  `color` text,
  `btnshape` text,
  `wseason` text,
  `style` text,
  `gender` text,
  `image` longblob,
  `rank` int(11) default NULL,
  `dt` text,
  `sname` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

